import { AppBar, Toolbar, styled } from '@mui/material';
import React from 'react';
import { NavLink } from 'react-router-dom';

const Header = styled(AppBar)`
background:#111111;
`
const P = styled('p')`
    font-size:15px;
    margin-right:20px;
`


const AdminNavBar = () => {
    return(

        <Header>
            <Toolbar>
                <NavLink>View Users</NavLink>
                <NavLink>Create Submission Types</NavLink>
                <NavLink>Allocate Panel Members</NavLink>
                <NavLink>Create Marking Scheme</NavLink>
                <NavLink>Upload</NavLink>
            </Toolbar>
        </Header>  
      )
}

export default AdminNavBar;
